import axios from "axios";
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

const OrderProduct = () => {
  const [orderData, setOrderData] = useState([]);
  const [orderedProduct, setOrderedProduct] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    console.log("Hello World");
    getOrderedProduct();
  }, []);

  const getOrderedProduct = () => {
    axios.get(`/order/get/${id}`).then((response) => {
      setOrderData(response.data);
      console.log(response.data.orderedProducts);
      setOrderedProduct(response.data.orderedProducts);
      console.log(response.data);
    });
  };

  const getMessage = () =>{
      console.log("Hello" + orderedProduct);
  }

  const ShowOrderedProduct = () => {
    return (
      <div className="text-center">
        <div className="card">
          <div className="card-body">
              {getMessage()}
            <h5 className="card-title">Hello</h5>;
            <h6 className="card-subtitle mb-2 text-muted">{orderData.id}</h6>
            <h6 className="card-subtitle mb-2 text-muted">
              {orderData.boughtAt}
            </h6>
            <p className="card-text"></p>
          </div>
        </div>
      </div>
    );
  };

  return <ShowOrderedProduct />;
};

export default OrderProduct;
